import React from 'react';

const Divider = (props, toggleClass) => {
  return (
      <div className={this.state.active ? 'your_className': null} onClick={(e) => {
          e.stopPropagation();
          props.onDividerClick(props);
          this.toggleClass();
      }}>{props.divider}</div>
  );
}

export default Divider;
